import React from "react";

const VulnerabilityTable = () => {
    const vulnerabilities = [
        { id: 1, type: "SQL Injection", severity: "High", status: "Open" },
        { id: 2, type: "Cross-Site Scripting", severity: "Medium", status: "Closed" },
        { id: 3, type: "Remote Code Execution", severity: "Critical", status: "Open" },
        { id: 4, type: "Denial of Service", severity: "Low", status: "Open" },
    ];
    
    return (
        <div className="vulnerability-table">
        <h2>Vulnerabilities</h2>
        <table>
            <thead>
            <tr>
                <th>ID</th>
                <th>Type</th>
                <th>Severity</th>
                <th>Status</th>
            </tr>
            </thead>
            <tbody>
            {vulnerabilities.map((vuln) => (
                <tr key={vuln.id}>
                <td>{vuln.id}</td>
                <td>{vuln.type}</td>
                <td>{vuln.severity}</td>
                <td>{vuln.status}</td>
                </tr>
            ))}
            </tbody>
        </table>
        </div>
    );
    }
export default VulnerabilityTable;
